package demo;

public class nestedforloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    
        System.out.println("Nested for loop");
        for (int i=1;i<=3;i++) 
        {
        	for(int j=1;j<=3;j++)
        	{
        		System.out.println(i+" "+j);
        	}
        	
        }
	}

}
